import React from "react";

const Movies = (props) => {
  const { data } = props;

  return (
    <div>
      <p>Total- {data.length} movies.</p>
      <ul>
        {data.map((m) => {
          return `
        <li key=${m.id}>
        <h3>${m.title}</h3>
        <p>Rating: ${m.vote_average}</p>
        </>
        `;
        })}
      </ul>
    </div>
  );
};

export default Movies;
